INSERT INTO `errors` VALUES (1,'Known','img','img element missing alt attribute.','Add an alt attribute to your img element.','Success Criteria 1.1.1 Non-text Content (A)',NULL,NULL,NULL),(2,'Likely','img','Image has suspicious Alt text (same as filename).','1. Check each img element and compare its alt attribute value to its src attribute value.','Success Criteria 1.1.1 Non-text Content (A)',NULL,NULL,NULL),(3,'Potential','img','Image Alt text may be too long.','1. For each img element, calculate the length of text within the alt attribute value.2. If the Alt text is greater than 100 characters (English) then it must be shortened or the user must confirm that it is the shortest Alt text possible.','Success Criteria 1.1.1 Non-text Content (A)',NULL,NULL,NULL),(4,'Likely','img','Image has suspicious Alt text (empty string \"\").','1. Check each img element and view its alt attribute value.2. If the alt attribute value is an empty string (\"\") then proceed to the next step.3. Determine if the image has non-decorative content.','WCAG 2.0(AA)',NULL,NULL,NULL),(5,'Likely','img','Image has suspicious Alt text (all spaces).','1. Check each img element that has width and height attribute values that are both greater than 25.2. View the alt attribute value for the img element.','WCAG 2.0(AA)',NULL,NULL,NULL),(6,'Likely','img','Image has suspicious Alt text (placeholder text).','1. Check each img element and compare its alt attribute value to the list of placeholder values.2. alt attribute placeholder values are: \'nbsp\', \'spacer\' and src attribute value (filename).','Success Criteria 1.1.1 Non-text Content (A)',NULL,NULL,NULL),(7,'Known','img','Image used as anchor is missing valid Alt text.','Add Alt text that identifies the purpose or function of the image.','Success Criteria 1.1.1 Non-text Content (A)',NULL,NULL,NULL),(8,'Potential','img','img element may require a long description.','1. For each img element, view the associated image and Alt text.2. Determine if a longer description than the Alt text is required for the image.3. If a longer description is required, check if it is provided by one of the 3 following methods.4. Method 1 - Check if there is a longdesc attribute for the img element and the longdesc target text fully describes the image.5. Method 2 - Check if the body text fully describes the image. (Note: the Alt text for the image must refer to the position in the document of the text that fully describes the image.)6. Method 3 - Check if there is a link immediately following the image that goes to an accessible text file that fully describes the image.','Success Criteria 1.1.1 Non-text Content (A)',NULL,NULL,NULL),(9,'Known','img','IMG missing d-link.','Immediately following the image, add an anchor that links to your long description file. The text of the anchor should be the letter \'d\'.','WCAG 2.0(AA)',NULL,NULL,NULL),(10,'Potential','img','Image (GIF) may flicker.','1. Check each img element that has a src attribute value ending in \'.gif\'.2. View the associated image and determine if it flickers using the general flash threshold and red flash threshold.','Success Criteria 2.3.1 Three Flashes or Below Threshold (A)',NULL,NULL,NULL),(11,'Potential','img','Image may contain text that is not in Alt text.','1. Alt text for all img elements contains all text in the image unless the image text is decorative or appears elsewhere in the content.','Success Criteria 1.1.1 Non-text Content (A)',NULL,NULL,NULL),(12,'Known','img','Server-side image map used without client-side image map.','Create a client-side image map that duplicates the functionality of the server-side image map.','WCAG 2.0(AA)',NULL,NULL,NULL),(13,'Known','img','Client-side image map missing duplicate text links.','For each area element in an image-map, provide an equivalent anchor on the page. The anchor must have an href attribute set to the same value as the area element\'s href attribute. The anchor\'s text should be the same as the area element\'s Alt text.','WCAG 2.0(AA)',NULL,NULL,NULL),(14,'Potential','img','Image may be using color alone.','1. View the text of the document.2. Check each image in the document.3. View the alt text for each image.','Success Criteria 1.4.1 Use of Color (A)',NULL,NULL,NULL),(15,'Potential','img','Alt text may not identify the link destination.','1. Alt text for all img elements used as source anchors identifies the destination of the link.','WCAG 2.0(AA)',NULL,NULL,NULL),(16,'Potential','img','Alt text is not empty and image may be decorative.','1. Check each img element and view its Alt text.2. Determine if the image is decorative.3. Note: For this document, \"decorative\" is defined as \"content that does not provide information, functionality, sensory experience and is neither multimedia nor time-dependent interactive\".','Success Criteria 1.1.1 Non-text Content (A)',NULL,NULL,NULL),(17,'Potential','a','Sound file may be missing text transcript.','1. Check each a (anchor) element that contains an href attribute value that ends        with a sound file extension.2. Sound file extensions are: (all case insensitive): .wav, .snd, .mp3, .iff, .svx, .sam, .smp, .vce, .vox, .pcm, .aif3. Listen to the sound file to determine if it requires a text transcript.4. If the sound file requires a text transcript, check if the document contains the text transcript or a link to it.','Success Criteria 1.2.1 Audio-only and Video-only (Prerecorded) (A)',NULL,NULL,NULL),(18,'Likely','a','Anchor that opens new window may be missing warning.','1. Check each a (anchor) element that contains a target attribute.2. Ignore an a (anchor) elements that contain a target attribute value of _self, _top, or _parent.3. Check the document text to see if there is a warning to the user that the a (anchor) element opens a new window.','Success Criteria 3.2.5 Change on Request (AAA)',NULL,NULL,NULL),(19,'Potential','a','Link text may not be meaningful.','1. Check each a (anchor) element that contains one or more characters.2. View the link text and confirm that it is meaningful when read out of context.','Success Criteria 2.4.4 Link Purpose (In Context) (A)',NULL,NULL,NULL),(20,'Likely','a','Link to multimedia may be missing a text transcript.','1. Check each a (anchor) element that contains an href attribute value that ends        with a multi-media file extension.2. Sound file extensions are: (all case insensitive): .wmv, .mpg, .mov, .ram, .aif3. View the document text.','Success Criteria 1.2.1 Audio-only and Video-only (Prerecorded) (A)',NULL,NULL,NULL),(21,'Potential','applet','applet may use color alone.','1. View the operation of each applet in the document.','Success Criteria 1.4.1 Use of Color (A)',NULL,NULL,NULL),(22,'Potential','applet','applet may flicker.','1. View the operation of each applet in the document.2. Determine if the applet flickers according to the general flash threshold and red flash threshold.','Success Criteria 2.3.1 Three Flashes or Below Threshold (A)',NULL,NULL,NULL),(23,'Potential','applet','applet may not contain a text equivalent in the alt attribute.','1. View the alt attribute value for the applet.','Success Criteria 1.1.1 Non-text Content (A)',NULL,NULL,NULL),(24,'Potential','applet','Text equivalent may not have been updated when applet changed.','1. Check the text equivalent for each applet element in the document.','Success Criteria 1.1.1 Non-text Content (A)',NULL,NULL,NULL),(25,'Potential','applet','applet body may not contain a text equivalent.','1. View the content of the applet element.','Success Criteria 1.1.1 Non-text Content (A)',NULL,NULL,NULL),(26,'Potential','applet','applet user interface may not be accessible.','1. View the operation of each applet in the document.','Success Criteria 2.1.1 Keyboard (A)',NULL,NULL,NULL),(27,'Known','blink','blink element used.','Remove the blink element (replace with STRONG or EM).','Success Criteria 2.2.2 Pause, Stop, Hide (A)',NULL,NULL,NULL),(28,'Potential','body','Document may be missing a \"skip to content\" link.','1. Determine if the document contains a block of material prior to the main content.2. Check if the document contains a link that bypasses the block of material and goes to the main content.3. Check if the \"skip to content\" link is the first link in the document.4. Check if the \"skip to content\" link is identified properly (i.e. the link text is \"skip to content\" or \"skip navigation\").','Success Criteria 2.4.1 Bypass Blocks (A)',NULL,NULL,NULL),(29,'Known','html','doctype declaration missing.','Add a valid doctype declaration to the document.','WCAG 2.0(AA)',NULL,NULL,NULL),(30,'Potential','object','object may flicker.','1. View the operation of each object element in your document.2. Determine if the object flickers using the general flash threshold and red flash threshold.','Success Criteria 2.3.1 Three Flashes or Below Threshold (A)',NULL,NULL,NULL),(31,'Known','frame','frame missing title attribute.','Add a title attribute to your frame element.','Success Criteria 2.4.1 Bypass Blocks (A)',NULL,NULL,NULL),(32,'Potential','frame','frame title may not describe the purpose or function of the frame.','1. Check the title attribute of each frame element in the content.2. View the content within the frame.','Success Criteria 2.4.1 Bypass Blocks (A)',NULL,NULL,NULL),(33,'Potential','frame','frame source may not be accessible content.','1. Check the src attribute of each frame element in the content.2. View the content associated with the src attribute.','WCAG 2.0(AA)',NULL,NULL,NULL),(34,'Likely','frameset','Relationship between frames may not be described.','1. Count the number of frames in each frameset.2. If the frameset contains 3 or more frames then check for a longdesc attribute on the frameset element.3. Check the content that is referenced by the longdesc attribute to see if it contains a description of the relationship between the frames.','WCAG 2.0(AA)',NULL,NULL,NULL),(35,'Known','frameset','frameset missing noframes section.','Add a noframes section within the frameset.','WCAG 2.0(AA)',NULL,NULL,NULL),(36,'Potential','noframes','NOFRAMES section may not contain a text equivalent of FRAMES section.','1. Check the contents of each NOFRAMES element.','WCAG 2.0(AA)',NULL,NULL,NULL),(37,'Known','h1','Header nesting - header following h1 is incorrect.','Modify the header levels so only an h1 or h2 follows h1.','Success Criteria 2.4.6 Headings and Labels (AA)',NULL,NULL,NULL),(38,'Known','h2','Header nesting - header following h2 is incorrect.','Modify the header levels so only an h3 or any header less than h3 follows h2.','Success Criteria 2.4.6 Headings and Labels (AA)',NULL,NULL,NULL),(39,'Known','h3','Header nesting - header following h3 is incorrect.','Modify the header levels so the header following an h3 is h1, h2, h3 or h4.','Success Criteria 2.4.6 Headings and Labels (AA)',NULL,NULL,NULL),(40,'Known','h4','Header nesting - header following h4 is incorrect.','Modify the header levels so the header following an h4 is h1, h2, h3, h4 or h5.','Success Criteria 2.4.6 Headings and Labels (AA)',NULL,NULL,NULL),(41,'Known','h5','Header nesting - header following h5 is incorrect.','Modify the header levels so h6 follows h5.','Success Criteria 2.4.6 Headings and Labels (AA)',NULL,NULL,NULL),(42,'Potential','h1','h1 may be used for formatting.','1. Check the contents of each h1 element.','Success Criteria 2.4.6 Headings and Labels (AA)',NULL,NULL,NULL),(43,'Potential','h2','h2 may be used for formatting.','1. Check the contents of each h2 element.','Success Criteria 2.4.6 Headings and Labels (AA)',NULL,NULL,NULL),(44,'Potential','h3','h3 may be used for formatting.','1. Check the contents of each h3 element.','Success Criteria 2.4.6 Headings and Labels (AA)',NULL,NULL,NULL),(45,'Potential','h4','h4 may be used for formatting.','1. Check the contents of each h4 element.','Success Criteria 2.4.6 Headings and Labels (AA)',NULL,NULL,NULL),(46,'Potential','h5','h5 may be used for formatting.','1. Check the contents of each h5 element.','Success Criteria 2.4.6 Headings and Labels (AA)',NULL,NULL,NULL),(47,'Potential','h6','h6 may be used for formatting.','1. Check the contents of each h6 element.','Success Criteria 2.4.6 Headings and Labels (AA)',NULL,NULL,NULL),(48,'Known','html','Document language not identified.','For HTML documents add the lang attribute and a valid ISO-639-1 two letter language code to the opening HTML element. For XHTML documents add both the lang and xmllang attributes with a valid ISO-639-1 two letter language code to the opening HTML element.','Success Criteria 3.1.1 Language of Page (A)',NULL,NULL,NULL),(49,'Known','html','Document has invalid language code.','Add a valid 2 letter or 3 letter language code as defined in the ISO 639 specification to the HTML \'lang\' attribute. For XHTML, both \'lang\' and \'xml:lang\' must be set.','Success Criteria 3.1.1 Language of Page (A)',NULL,NULL,NULL),(50,'Known','head','Document missing title element.','1. Check the contents of the head element for the presence of a title element.','Success Criteria 2.4.2 Page Titled (A)',NULL,NULL,NULL),(51,'Known','title','title element is empty.','Add text to the title element.','Success Criteria 2.4.2 Page Titled (A)',NULL,NULL,NULL),(52,'Likely','title','title text may be too long.','1. View the text that is contained by the title element.2. The title element is expected to contain less than 150 characters (English) or the user must confirm that it is the shortest possible title.','Success Criteria 2.4.2 Page Titled (A)',NULL,NULL,NULL),(53,'Likely','title','title contains placeholder text.','1. View the text that is contained by the title element.\r\n2. Compare the title text to common placeholder values.','Success Criteria 2.4.2 Page Titled (A)',NULL,NULL,NULL),(54,'Potential','title','title might not describe the document.','1. View the text that is contained by the title element.2. View the document.','Success Criteria 2.4.2 Page Titled (A)',NULL,NULL,NULL),(55,'Potential','input','input possibly using color alone.','1. View all input elements except those that have a type attribute value of \"hidden\".','Success Criteria 1.4.1 Use of Color (A)',NULL,NULL,NULL),(57,'Known','input','input element, type of \"text\", missing an associated label.','Add a label element that surrounds the control\'s label. Set the for attribute on the label element to the same value as the id attribute of the control. And/or add a title attribute to the input element. And/or create a label element that contains the input element.','Success Criteria 1.3.1 Info and Relationships (A)',NULL,NULL,NULL),(58,'Known','input','Image used for input element is missing Alt text.','Add an alt attribute that describes the image to input element.','Success Criteria 1.1.1 Non-text Content (A)',NULL,NULL,NULL),(59,'Potential','input','Image used for input element may have Alt text that does not identify the purpose or function as the image.','1. Check all input elements that have a type attribute value of \"image\".2. Check the alt attribute value of the input element.','Success Criteria 1.1.1 Non-text Content (A)',NULL,NULL,NULL),(60,'Likely','input','Image used for input element has long Alt text.','1. Check all input elements that have a type attribute value of \"image\".2. Calculate the length of the Alt text.','Success Criteria 1.1.1 Non-text Content (A)',NULL,NULL,NULL),(61,'Likely','input','Image used in input element - Suspicious Alt text (same as filename).','1. Check all input elements that have a type attribute value of \"image\".2. Check the alt attribute value of the input element.3. Check the src attribute value of the input element.','WCAG 2.0(AA)',NULL,NULL,NULL),(62,'Likely','input','Image used in input element - Suspicious Alt text (placeholder).','1. Check all input elements that have a type attribute value of \"image\".\r\n2. Check the alt attribute value of the input element.','Success Criteria 1.1.1 Non-text Content (A)',NULL,NULL,NULL),(63,'Known','input','input element, type of \"text\", missing default text.','Add a \"value\" attribute to the input element. Set the text in the \"value\" attribute to the default text for the control.','WCAG 2.0(AA)',NULL,NULL,NULL),(64,'Known','area','Imagemap area element missing alt attribute.','Add an alt attribute to this area element. The alt attribute should describe the link destination and make sense when read out of context.','Success Criteria 1.1.1 Non-text Content (A)',NULL,NULL,NULL),(65,'Potential','area','Alt text for area element may not identify the link destination.','1. Check the alt attribute value of each area element.','Success Criteria 1.1.1 Non-text Content (A)',NULL,NULL,NULL),(66,'Likely','area','area link to sound file may be missing text transcript.','1. Check the alt attribute value of each area element.2. Check if the alt attribute value ends with a sound file suffix.3. Following is a sample list of sound file suffixes. This is not an exhaustive list and the author should test the actual file to determine if it is a sound file: .wav, .snd, .mp3, .iff, .svx, .sam, .smp, .vce, .vox, .pcm, and .aif.4. If the alt attribute value ends with a sound file suffix then check the content for a link to a sound file transcript.','Success Criteria 1.1.1 Non-text Content (A)',NULL,NULL,NULL),(68,'Likely','area','area opens new window may be missing warning.','1. Check for the presence of a target attribute on each area element.2. If the area element has a target attribute then check if the target attribute\'s value is one of _self, _top, or _parent.3. If the target attribute\'s value is not _self, _top, or _parent then check if the content text contains a warning letting the user know that the imagemap will open a new window.','Success Criteria 3.2.2 On Input (A)',NULL,NULL,NULL),(69,'Known','marquee','marquee element used.','Remove the marquee element (replace with strong or em).','Success Criteria 2.2.2 Pause, Stop, Hide (A)',NULL,NULL,NULL),(70,'Likely','menu','menu item may be used to format text.','1. Check each menu element in the content.2. Count the number of li elements contained by the menu element.3. If the menu element contains only one li element then check if the li element is really a list item.4. li elements may be misused to format text.','WCAG 2.0(AA)',NULL,NULL,NULL),(71,'Known','meta','Auto-redirect used.','Use a server-side redirect or place a link on the page that allows users to go to the new page.','Success Criteria 2.2.2 Pause, Stop, Hide (A)',NULL,NULL,NULL),(72,'Known','meta','Meta refresh with a time-out is used.','Remove the meta element from the document or set the content attribute value to zero.','Success Criteria 2.2.1 Timing Adjustable (A)',NULL,NULL,NULL),(73,'Potential','object','object may be using color alone.','1. It is expected that the object will not use color alone','Success Criteria 1.4.1 Use of Color (A)',NULL,NULL,NULL),(74,'Potential','object','Text equivalent for object may not have been updated when object changed.','1. View each object element in the content and its text equivalent.','WCAG 2.0(AA)',NULL,NULL,NULL),(75,'Potential','object','Content may not be usable when object is disabled.','1. Disable or remove each object element and then view the content.','WCAG 2.0(AA)',NULL,NULL,NULL),(76,'Potential','object','object user interface may not be accessible.','1. Operate the user interface for each object.2. Check if the object can be operated with the keyboard.','Success Criteria 2.1.1 Keyboard (A)',NULL,NULL,NULL),(77,'Potential','object','object link to multimedia file may be missing text transcript.','1. Check each object element and view the type attribute value.2. If the type attribute value is \"video\" then check the content for a text equivalent for the object.3. The text equivalent may be within the text of the content or there may be a link to the text equivalent.','WCAG 2.0(AA)',NULL,NULL,NULL),(78,'Known','object','object missing title.','Add a title attribute to your object element.','WCAG 2.0(AA)',NULL,NULL,NULL),(79,'Known','object','object has invalid title.','Modify the title attribute to your object element so it contains text.','WCAG 2.0(AA)',NULL,NULL,NULL),(80,'Potential','object','object may be missing a text equivalent.','1. Check each object element and view its content.','Success Criteria 1.1.1 Non-text Content (A)',NULL,NULL,NULL),(81,'Likely','ol','List item used to format text.','1. Check each OL element in the content. 2. Count the number of LI elements contained by the OL element. 3. If the OL element contains only one LI element then check if the LI element is really a list item. 4. LI elements may be misused to format text.','Success Criteria 3.2.4 Consistent Identification (AA)',NULL,NULL,NULL),(82,'Likely','p','p element may be misused (could be a header).','1. Check the contents of all p elements in the document.2. Check if all the text contained by the p element is marked with presentational elements.3. Presentational elements include the elements b, i, u, strong, span, font, and em.4. If all the text is marked with a presentational element then determine if the text might be better marked as a header.','Success Criteria 1.3.1 Info and Relationships (A)',NULL,NULL,NULL),(83,'Likely','pre','ASCII art not replaced with image.','1. Find any ASCII art within the document.','WCAG 2.0(AA)',NULL,NULL,NULL),(84,'Likely','pre','ASCII art possibly missing a skipover link.','1. Find any ASCII art within the document.','Success Criteria 2.4.1 Bypass Blocks (A)',NULL,NULL,NULL),(86,'Potential','script','script may use color alone.','1. View the operation of each SCRIPT in the document.','Success Criteria 1.4.1 Use of Color (A)',NULL,NULL,NULL),(87,'Potential','script','script may cause screen flicker.','1. View the operation of each script in the document.','Success Criteria 2.3.1 Three Flashes or Below Threshold (A)',NULL,NULL,NULL),(88,'Potential','script','Content may not be accessible when script is disabled.','1. Remove or disable each script within the document.','WCAG 2.0(AA)',NULL,NULL,NULL),(89,'Potential','script','script user interface may not be accessible.','1. View the operation of each script in the content.2. Check if the script user interface may be accessed by the keyboard.','Success Criteria 2.1.1 Keyboard (A)',NULL,NULL,NULL),(90,'Known','script','script must have a noscript section.','Add a noscript section immediately following the script that provides the same functionality as the script.','WCAG 2.0(AA)',NULL,NULL,NULL),(91,'Known','select','select element missing an associated label.','Add a label element that surrounds the control\'s label. Set the for attribute on the label element to the same value as the id attribute of the control. And/or add a title attribute to the input element. And/or create a label element that contains the input element.','Success Criteria 1.3.1 Info and Relationships (A)',NULL,NULL,NULL),(92,'Likely','select','select element may cause extreme change in context.','1. Check all select elements in the content.2. Check if the select element contains an onchange attribute.3. Examine the onchange handler for any action that will cause the page to reload or cause an extreme change of context.4. Actions that will cause the page to reload or cause an extreme change of context may be variations of one of the following JavaScript statements:5. form.submit();6. window.location.href = uri;7. elementElsewhereOnThePage.focus();8. (@@other examples??)','Success Criteria 3.2.2 On Input (A)',NULL,NULL,NULL),(94,'Likely','script','Content possibly not readable when stylesheets are removed (SCRIPT).','1. Remove or disable each SCRIPT element.2. Check if the content is still readable.','WCAG 2.0(AA)',NULL,NULL,NULL),(95,'Known','textarea','textarea element missing an associated label.','Add a label element immediately before or after the textarea element. Set the for attribute value of the label element to the same value as the id attribute value of the textarea element. Add label text to the label element. Or, set the title attribute value to the textarea element to the label text. Or, add a label element that surrounds the textarea element and add label text.','Success Criteria 1.3.1 Info and Relationships (A)',NULL,NULL,NULL),(96,'Potential','textarea','textarea label is not positioned close to control.','Position the control\'s label so it is close to the control.','Success Criteria 1.3.1 Info and Relationships (A)',NULL,NULL,NULL),(97,'Potential','link','Document may not be readable when stylesheets are removed.','1. Check for any link elements that have a rel attribute value of \"stylesheet\".2. If any of these elements are found then remove or disable them.3. View the document to ensure it is readable.','WCAG 2.0(AA)',NULL,NULL,NULL),(98,'Potential','body','Abbreviations may not be marked with abbr element.','1. Check the document for any text abbreviations.2. If an abbreviation is found, check if it is properly marked with the abbr element.','Success Criteria 3.1.4 Abbreviations (AAA)',NULL,NULL,NULL),(99,'Potential','body','Acronyms may not be marked with acronym element.','1. Check the content for any text Acronyms.2. If an Acronyms is found, check if it is properly marked with the acronym element.','Success Criteria 3.1.4 Abbreviations (AAA)',NULL,NULL,NULL),(100,'Potential','blockquote','blockquote may be used for indentation.','1. Check each blockquote element in the content.2. Check if the text enclosed by the blockquote element is really a quote.','Success Criteria 3.2.4 Consistent Identification (AA)',NULL,NULL,NULL),(101,'Likely','iframe','iframe missing alternate content.','1. TODO.','WCAG 2.0(AA)',NULL,NULL,NULL),(102,'Known','all elements','SCRIPT not keyboard accessible - onclick missing onkeypress.','Add a onkeypress handler to your SCRIPT that performs the same function as the onclick function.','WCAG 2.0(AA)',NULL,NULL,NULL),(103,'Potential','all elements','script may not be keyboard accessible - ondblclick requires keyboard specific functions.','1. Check each element in the document for an ondblclick  attribute.2. Check if there are keyboard operations that perform the same function.','Success Criteria 2.1.1 Keyboard (A)',NULL,NULL,NULL),(104,'Known','all elements','onmousedown event missing onkeydown event.','Add an onkeydown handler to your script that performs the same function as the onmousedown function.','Success Criteria 2.1.1 Keyboard (A)',NULL,NULL,NULL),(105,'Potential','all elements','script may not be keyboard accessible - onmousemove requires keyboard specific functions.','1. Check each element in the document for an onmousemove attribute.2. Check if there are keyboard operations that perform the same function.','Success Criteria 2.1.1 Keyboard (A)',NULL,NULL,NULL),(106,'Known','all elements','script not keyboard accessible - onmouseout missing onblur.','Add an onblur handler to your script that performs the same function as the onmouseout handler.','Success Criteria 2.1.1 Keyboard (A)',NULL,NULL,NULL),(107,'Known','all elements','onmouseover event handler missing onfocus event handler.','Add an onfocus handler to your script that performs the same function as the onmouseover handler.','Success Criteria 2.1.1 Keyboard (A)',NULL,NULL,NULL),(108,'Known','all elements','onmouseup event handler missing onkeyup event handler.','Add an onkeyup handler to your script that performs the same function as the onmouseup handler.','Success Criteria 2.1.1 Keyboard (A)',NULL,NULL,NULL),(109,'Likely','all elements','Content may not be readable when stylesheets are removed.','1. Check the document for the style attribute on any element.2. Remove or disable any style attributes.3. View the page and discern if it is still readable.','WCAG 2.0(AA)',NULL,NULL,NULL),(110,'Potential','body','Words or phrases that are not in the document\'s primary language may not be identified.','1. Check the document for any words or phrases that are not in the document\'s primary language.2. Check if these words are marked using the lang attribute.','Success Criteria 3.1.2 Language of Parts (A)',NULL,NULL,NULL),(111,'Potential','table','Table may require a summary.','1. Check all data tables in the document.2. Determine if the table is complex enough to require a summary.3. Note: A table is complex if it has several sets of row or column headers, or if it has multiple groups of columns or rows.4. Check if the table has a summary attribute.','Success Criteria 1.3.1 Info and Relationships (A)',NULL,NULL,NULL),(112,'Known','table','Data table summary is empty.','Add text to the summary attribute on each table element.','Success Criteria 1.3.1 Info and Relationships (A)',NULL,NULL,NULL),(113,'Likely','table','Data table summary is less than 10 characters.','1. For all data tables, check the summary attribute of table element and determine its length.2. Note: This table has been identified as a data table because it contains th elements. If this is a layout table then remove the th elements from the table.','WCAG 2.0(AA)',NULL,NULL,NULL),(114,'Known','table','Layout table has a summary.','Remove the summary attribute from all layout table elements or set the summary attribute value so it contains no printable characters.','Success Criteria 1.3.1 Info and Relationships (A)',NULL,NULL,NULL),(115,'Known','table','Layout table contains a caption.','Remove the table\'s caption element.','Success Criteria 1.3.1 Info and Relationships (A)',NULL,NULL,NULL),(116,'Known','b','b (bold) element used.','Replace your b (bold) elements with em or strong.','Success Criteria 1.4.4 Resize text (AA)',NULL,NULL,NULL),(117,'Known','i','i (italic) element used.','Replace your i elements with em or strong.','Success Criteria 1.4.4 Resize text (AA)',NULL,NULL,NULL),(118,'Known','input','input element, type of \"password\", missing an associated label.','Add a label element that surrounds the control\'s label. Set the for attribute on the label element to the same value as the id attribute of the control. And/or add a title attribute to the input element. And/or create a label element that contains the input element.','Success Criteria 1.3.1 Info and Relationships (A)',NULL,NULL,NULL),(119,'Known','input','input element, type of \"checkbox\", missing an associated label.','Add a label element that surrounds the control\'s label. Set the for attribute on the label element to the same value as the id attribute of the control. And/or add a title attribute to the input element. And/or create a label element that contains the input element.','Success Criteria 1.3.1 Info and Relationships (A)',NULL,NULL,NULL),(120,'Known','input','input element, type of \"file\", missing an associated label.','Add a label element that surrounds the control\'s label. Set the for attribute on the label element to the same value as the id attribute of the control. And/or add a title attribute to the input element. And/or create a label element that contains the input element.','Success Criteria 1.3.1 Info and Relationships (A)',NULL,NULL,NULL),(121,'Known','input','input element, type of \"radio\", missing an associated label.','Add a label element that surrounds the control\'s label. Set the for attribute on the label element to the same value as the id attribute of the control. And/or add a title attribute to the input element. And/or create a label element that contains the input element.','Success Criteria 1.3.1 Info and Relationships (A)',NULL,NULL,NULL),(122,'Potential','input','input element label, type of \"password\" is not positioned close to control.','1. Check all input  elements that have a type attribute value of \"password\".2. View the input element within the document and check the positioning of its label.','Success Criteria 1.3.1 Info and Relationships (A)',NULL,NULL,NULL),(123,'Potential','input','input element label, type of \"checkbox\" is not positioned close to control.','1. Check all input elements that have a type attribute value of \"checkbox\".2. View the input element within the document and check the positioning of its label.','Success Criteria 1.3.1 Info and Relationships (A)',NULL,NULL,NULL),(124,'Potential','input','input element label, type of \"file\", is not positioned close to control.','1. Check all input  elements that have a type attribute value of \"file\".2. View the input element within the document and check the positioning of its label.','Success Criteria 1.3.1 Info and Relationships (A)',NULL,NULL,NULL),(125,'Potential','input','input element label, type of \"radio\", is not positioned close to control.','1. Check all input  elements that have a type attribute value of \"radio\".2. View the input element within the document and check the positioning of its label.','Success Criteria 1.3.1 Info and Relationships (A)',NULL,NULL,NULL),(126,'Known','input','Text input element missing valid default text.','Add a VALUE attribute to this input element that contains default text.','WCAG 2.0(AA)',NULL,NULL,NULL),(127,'Potential','object','Text equivalent for object may not have been updated when object changed.','1. Check the text equivalent for all object elements in the content.','WCAG 2.0(AA)',NULL,NULL,NULL),(128,'Potential','object','Content may not be usable when object is disabled.','1. Remove or disable each object element in the content.2. View the content with the object removed or disabled.','WCAG 2.0(AA)',NULL,NULL,NULL),(129,'Potential','object','object user interface may not be accessible.','1. View each object within the document.2. Test the user interface of each object and check if it can be operated by the keyboard.','WCAG 2.0(AA)',NULL,NULL,NULL),(131,'Potential','body','Long quotations may not be marked using the blockquote element.','1. View the text within the document and identify and block quotes.2. Check if the text blocks are marked using the blockquote element.','Success Criteria 3.2.4 Consistent Identification (AA)',NULL,NULL,NULL),(132,'Potential','img','Server-side image map may be missing equivalent text links.','1. For each img element containing an ismap attribute, view the links in the server-side map.2. For each active area in the server-side image map, find an equivalent text link within the document.','WCAG 2.0(AA)',NULL,NULL,NULL),(133,'Potential','table','Layout table may not linearize.','1. Check each layout table in the document.2. View the table cells in order starting at the top left corner and work row by row to the bottom right corner.3. Check if the table cells make sense when viewed one at a time in order.','Success Criteria 1.3.1 Info and Relationships (A)',NULL,NULL,NULL),(134,'Known','a','Adjacent links are not separated properly.','Insert printable characters (surrounded by spaces) between adjacent links.','WCAG 2.0(AA)',NULL,NULL,NULL),(135,'Potential','img','Image may contain math statements.','1. Check each img element in the content.2. Discern if there are any math expressions in the image.3. If the image does contain a math expression then check the content for MathML markup that is equivalent to the math expression.','WCAG 2.0(AA)',NULL,NULL,NULL),(136,'Potential','table','Data table may require th elements.','1. Check each data table and determine if it contains th elements.2. Note: This table has been identified as a layout table because it does not contain th elements. If this is a data table then add th elements to the table','Success Criteria 1.3.1 Info and Relationships (A)',NULL,NULL,NULL),(137,'Potential','table','Layout table may be misusing th elements.','1. Check each table in the document.2. Determine if the table is used for layout purposes.3. Check if the table contains th elements.','Success Criteria 1.3.1 Info and Relationships (A)',NULL,NULL,NULL),(138,'Known','input','input element, type of \"text\", missing a tab index.','Add a tabindex attribute to your input element.','WCAG 2.0(AA)',NULL,NULL,NULL),(139,'Known','input','input element, type of \"radio\", missing a tab index.','Add a tabindex attribute to your input element.','WCAG 2.0(AA)',NULL,NULL,NULL),(140,'Known','input','input element, type of \"password\", missing a tab index.','Add a tabindex attribute to your input element.','WCAG 2.0(AA)',NULL,NULL,NULL),(141,'Known','input','input element, type of \"checkbox\", missing a tab index.','Add a tabindex attribute to your input element.','WCAG 2.0(AA)',NULL,NULL,NULL),(142,'Known','input','input element, type of \"file\", missing a tab index.','Add a tabindex attribute to your input element.','WCAG 2.0(AA)',NULL,NULL,NULL),(143,'Known','html','Content missing address of page author.','Add an address element that describes the author\'s contact information.','WCAG 2.0(AA)',NULL,NULL,NULL),(144,'Potential','address','address of page author may be incorrect.','1. Check the content for an address element.2. If an address element is found, check if it contains a valid address of the author.','WCAG 2.0(AA)',NULL,NULL,NULL),(145,'Likely','a','Link to multimedia may be missing a link to text alternative.','1. Check each a (anchor) element in the content.2. Check the href attribute value for a multimedia file extension.3. Common multimedia file extensions are .wmv, .mpg, .mov, .ram, and .aif.4. If the document contains a link to a multimedia file, then check for a link to a text alternative.5. The link to the text alternative must be immediately before or immediately after the link to the multimedia file.','Success Criteria 1.2.1 Audio-only and Video-only (Prerecorded) (A)',NULL,NULL,NULL),(146,'Potential','object','object link to multimedia file may be missing equivalent alternative.','1. Check each object element for a type attribute value of \"video\".2. If this object is found then check the content for either a text equivalent for the object file or a link to a text equivalent.','Success Criteria 1.2.3 Audio Description or Media Alternative (Prerecorded) (A)',NULL,NULL,NULL),(1