(AA)',NULL,NULL,NULL),(156,'Known','ol','Link group missing title.','Add a title attribute to the element (OL, UL, DIV or MAP) that contains the link set and make the title value describe the link group.','WCAG 2.0(AA)',NULL,NULL,NULL),(157,'Potential','ol','Link group title may not describe the link group.','1. TODO.','WCAG 2.0(AA)',NULL,NULL,NULL),(158,'Potential','ol','CSS not used to hide link group.','1. TODO.','WCAG 2.0(AA)',NULL,NULL,NULL),(159,'Known','img','IMG using title.','Remove the title attribute from the img element.','WCAG 2.0(AA)',NULL,NULL,NULL),(160,'Potential','object','object may require a long description.','1. Check all object elements for the presence of a long description.2. [editor note: where should the long description be?]','Success Criteria 1.2.3 Audio Description or Media Alternative (Prerecorded) (A)',NULL,NULL,NULL),(161,'Known','body','Excessive use of emoticons.','Remove the emoticons and replace them with text (i.e. \"wink\", \"grin\" etc.)','WCAG 2.0(AA)',NULL,NULL,NULL),(162,'Known','body','Emoticon missing abbr.','Add an abbr element around the emoticon and set its title attribute to a description of the emoticon.','WCAG 2.0(AA)',NULL,NULL,NULL),(163,'Known','embed','embed element missing noembed element.','Add a noembed element within or beside the embed element. Add text to the noembed element that is equivalent to the embed element.','Success Criteria 1.1.1 Non-text Content (A)',NULL,NULL,NULL),(164,'Potential','noembed','noembed may not have equivalent content to embed.','1. TODO.','WCAG 2.0(AA)',NULL,NULL,NULL),(165,'Known','embed','embed missing alt attribute.','Add an alt attribute to the embed element. The alt attribute value should describe the embed source.','WCAG 2.0(AA)',NULL,NULL,NULL),(166,'Known','embed','embed has null Alt text.','Add text to the alt attribute that describes the embed source.','WCAG 2.0(AA)',NULL,NULL,NULL),(167,'Known','iframe','iframe contains a longdesc attribute.','Remove the longdesc attribute from the Iframe element.','WCAG 2.0(AA)',NULL,NULL,NULL),(168,'Known','form','Form missing fieldset and legend to group multiple radio buttons.','Add a fieldset and legend element to the form for each group of radio buttons.','Success Criteria 1.3.1 Info and Relationships (A)',NULL,NULL,NULL),(169,'Likely','select','optgroup may be required for large number of options.','1. TODO.','WCAG 2.0(AA)',NULL,NULL,NULL),(173,'Likely','a','Suspicious link text (contains placeholder text).','1. Check the text contained by each a (anchor) element.','Success Criteria 2.4.4 Link Purpose (In Context) (A)',NULL,NULL,NULL),(174,'Known','a','Anchor contains no text.','Add text to the a element or the title attribute of the a element or, if an image is used within the anchor, add Alt text to the image.','Success Criteria 2.4.4 Link Purpose (In Context) (A)',NULL,NULL,NULL),(175,'Known','a','Anchor contains redundant text.','Change the image\'s Alt text or link text so they differ.','WCAG 2.0(AA)',NULL,NULL,NULL),(176,'Known','basefont','basefont used.','Remove the basefont element from the document.','Success Criteria 1.4.4 Resize text (AA)',NULL,NULL,NULL),(177,'Known','font','font used.','Remove the font element from the document.','Success Criteria 1.4.4 Resize text (AA)',NULL,NULL,NULL),(178,'Potential','img','Alt text does not convey the same information as the image.','1. Check each img element that is not a source anchor and view the associated image and Alt text.2. Note: If the img element is contained by an a (anchor) element and the a (anchor) element has a valid href attribute value then the image is a source anchor.','Success Criteria 1.1.1 Non-text Content (A)',NULL,NULL,NULL),(179,'Potential','body','Reference to glossary may be missing.','1. TODO.','Success Criteria 3.1.3 Unusual Words (AAA)',NULL,NULL,NULL),(180,'Known','a','Adjacent links with same resource are not combined.','Combine both a (anchor) elements into one anchor element.','WCAG 2.0(AA)',NULL,NULL,NUL