nchor) element to determine if it describes the link destination.2. Note that a source a (anchor) element must contain an href attribute.','WCAG 2.0(AA)',NULL,NULL,NULL),(192,'Known','input','input element type of \"image\" uses redundant words in Alt text.','Change the Alt text for the submit button so it does not use \"submit\" or \"button\".','WCAG 2.0(AA)',NULL,NULL,NULL),(193,'Potential','input','Form submit button image may contain text that is not in Alt text.','1. For each input element that has a type attribute value of \"image\", check if the associated image contains any text.2. If the image contains text, check if the text is decorative.3. Note: For this document, \"decorative\" is defined as \"content that does not provide information, functionality, sensory experience and is neither multimedia nor time-dependent interactive\".','Success Criteria 1.1.1 Non-text Content (A)',NULL,NULL,NULL),(194,'Potential','area','area image may contain text that is not in Alt text.','1. For each area element, check if the associated image contains any text.2. If the image contains text, check if the text is decorative.3. Note: For this document, \"decorative\" is defined as \"content that does not provide information, functionality, sensory experience and is neither multimedia nor time-dependent interactive\".','Success Criteria 1.1.1 Non-text Content (A)',NULL,NULL,NULL),(195,'Known','img','Link text begins with \"link to\" or \"go to\".','Remove \"link to\" or \"go to\" at the beginning of the Alt text.','WCAG 2.0(AA)',NULL,NULL,NULL),(196,'Potential','img','Server-side image map may be used improperly.','1. Check each img element that contains a ismap attribute.2. Check if the active regions of the image map can be defined using available geometric shapes.','WCAG 2.0(AA)',NULL,NULL,NULL),(197,'Potential','a','Anchor text may not identify the link destination.','1. View the link text for each source a (anchor) element.2. Note: A source a (anchor) element must contain an href attribute.3. Note: The link text may be contained in the body text of the a (anchor) element or the Alt text of an image used as a link.','WCAG 2.0(AA)',NULL,NULL,NULL),(198,'Potential','legend','legend text may not describe the group of choices.','1. View the text contained by each legend element.2. View the group of choices associated with the legend element.','WCAG 2.0(AA)',NULL,NULL,NULL),(199,'Known','legend','legend text is empty.','Add text to the legend element.','WCAG 2.0(AA)',NULL,NULL,NULL),(200,'Likely','legend','legend text may be placeholder text.','1. View the text contained by each legend element and compare it to the list of placeholder values.\r\n2. Placeholder values are \"legend\".','WCAG 2.0(AA)',NULL,NULL,NULL),(201,'Known','frame','frame titles is empty.','Add text to the frame element\'s title attribute.','WCAG 2.0(AA)',NULL,NULL,NULL),(202,'Potential','frame','frame title contains placeholder text.','1. Check each frame element and compare its title attribute value to the list of placeholder values.\r\n2. frame title placeholder values are: \'title\', \'the title\' and \'frame title\'.','WCAG 2.0(AA)',NULL,NULL,NULL),(203,'Potential','table','Data table summary may not describe navigation and structure of the table.','1. Check the contents of the summary attribute for each data table.2. Determine if the summary describes navigation and structure of the table.','Success Criteria 1.3.1 Info and Relationships (A)',NULL,NULL,NULL),(204,'Known','input','input element, type of \"radio\", has no text in label.','Add text to the input element\'s associated label that describes the purpose or function of the control.','Success Criteria 1.3.1 Info and Relationships (A)',NULL,NULL,NULL),(205,'Potential','input','input element, type of \"file\", label may not describe the purpose or function of the control.','1. All input elements, type of \"file\", have a label that describes the purpose or function of the control.','Success Criteria 3.3.2 Labels or Instructions (A)',NULL,NULL,NULL),(206,'Known','input','input element, type of \"checkbox\", has no text in label.','Add text to the input element\'s associated label that describes the purpose or function of the control.','Success Criteria 1.3.1 Info and Relationships (A)',NULL,NULL,NULL),(207,'Known','input','input element, type of \"password\", has no text in label.','Add text to the input element\'s associated label that describes the purpose or function of the control.','Success Criteria 1.3.1 Info and Relationships (A)',NULL,NULL,NULL),(208,'Known','select','Label text is empty for select element.','Add text to the label associated with the select element.','Success Criteria 1.3.1 Info and Relationships (A)',NULL,NULL,NULL),(209,'Potential','select','select element\'s label is not positioned close to control.','1. The label must be positioned close to the control.','Success Criteria 1.3.1 Info and Relationships (A)',NULL,NULL,NULL),(210,'Potential','select','select element\'s label may not describe the purpose or function of the control.','1. All select elements have a label that describes the purpose or function of the control.','Success Criteria 3.3.2 Labels or Instructions (A)',NULL,NULL,NULL),(211,'Potential','input','input element label, type of \"text\", is not positioned close to control.','1. Check all input  elements that have a type attribute value of \"text\".2. View the input element within the document and check the positioning of its label.','Success Criteria 1.3.1 Info and Relationships (A)',NULL,NULL,NULL),(212,'Known','textarea','textarea has no text in label.','Add text to the textarea element\'s associated label that describes the purpose or function of the control.','Success Criteria 1.3.1 Info and Relationships (A)',NULL,NULL,NULL),(213,'Known','input','input element, type of \"text\", has no text in label.','Add text to the input element\'s associated label that describes the purpose or function of the control.','Success Criteria 1