iteria 1.4.1 Use of Colour (A)',NULL,NULL,NULL),(222,'Known','body','Poor color contrast between link text and background color.','Change either the link attribute value or the bgcolor attribute value of the body element so the luminosity contrast ratio is greater than 5:1','Success Criteria 1.4.1 Use of Colour (A)',NULL,NULL,NULL),(223,'Known','body','Poor color contrast between active link text and background color.','Change either the alink attribute value or the bgcolor attribute value of the body element so the luminosity contrast ratio is greater than 5:1','Success Criteria 1.4.1 Use of Colour (A)',NULL,NULL,NULL),(224,'Known','body','Poor color contrast between visited link text and background color.','Change either the vlink attribute value or the bgcolor attribute value of the body element so the luminosity contrast ratio is greater than 5:1','Success Criteria 1.4.1 Use of Colour (A)',NULL,NULL,NULL),(225,'Known','html','Strict doctype is not declared.','Insert a \'strict\' doctype declaration at the start of the document.','WCAG 2.0(AA)',NULL,NULL,NULL),(226,'Known','body','Poor contrast between text and background color (WAI ERT algorithm).','Change either the text attribute value or the bgcolor attribute value of the body element so the contrast surpasses the WAI ERT color algorithm threshold.','WCAG 2.0(AA)',NULL,NULL,NULL),(227,'Known','body','Poor contrast between link text and background color (WAI ERT algorithm).','Change either the link attribute value or the bgcolor attribute value of the body element so the contrast surpasses the WAI ERT color algorithm threshold.','WCAG 2.0(AA)',NULL,NULL,NULL),(228,'Known','body','Poor contrast between active link text and background color (WAI ERT algorithm).','Change either the alink attribute value or the bgcolor attribute value of the body element so the contrast surpasses the WAI ERT color algorithm threshold.','WCAG 2.0(AA)',NULL,NULL,NULL),(229,'Known','body','Poor contrast between visited link text and 