nt contrast.','Success Criteria 1.4.3 Contrast (Minimum) (AA)',NULL,NULL,NULL),(310,'Known','a','Link text colour must provide high contrast with its background colour.','Use a colour contrast evaluator to determine if text and background colours provide a contrast ratio of 7:1 for standard text, or 4.5:1 for larger text. Change colour codes to produce sufficient contrast.','Success Criteria 1.4.3 Contrast (Minimum) (AA)',NULL,NULL,NULL);
